// TicketCard.js

import React from 'react';
import "./card.css"

const Card = ({ ticket }) => {

    if (!ticket) {
    return <div>No ticket data available</div>;
  }
  const { id, title, user, status, priority } = ticket;

  return (
    <div className="ticket-card">
      <h3>{title}</h3>
      <p>User: {user}</p>
      <p>Status: {status}</p>
      <p>Priority: {priority}</p>
      {/* Add additional information as needed */}
    </div>
  );
};

export default Card;
